import image from '../images/adalab-logo-155x61.png'


const Header=()=>{

    return (

<header className="header">

        <a href="https://adalab.es/" target="_BLANK"> <img className="logo" src={image} alt="adalab-logo" title="Go to Adalab"/> 
        </a>

        <nav>
             <ul className="menu-item">
                <li> <a tittle="Blog" class="menu-link" href="https://adalab.blog/">blog 
                </a> 
                </li>
                <li> <a href="https://adalab.es/contacto/" target="_BLANK" className="menu-item" title="Contact Adalab">contacto </a> </li>

             </ul>
        </nav>
    </header>
    );
}

export default Header;
